import React from 'react';
import {useEffect} from 'react';

function reducer(state, action) {
    switch (action.type) {
      case "ADD_DEET":
        return [...state, action.payload];
      default:
        return state;
    }
  }

export default function KanyeRest() {

    const [deets, dispatch] = React.useReducer(reducer, []);

    useEffect(() => {

        // http://flipacoinapi.com/json
        fetch("https://api.kanye.rest")
        .then(results => results.json())
        .then((data) => {

        const time = 10

        const  quoting = data.quote
        const deet = {quoting, time}

        console.log(data.quote)

        dispatch({ type: "ADD_DEET", payload: deet })

        });

    }, [])

    return (
    <div className='Fetch' >

<div> 
    {deets.map(({ deet, time }, i) => (
              <ul key={i} >
                <h2>quote</h2>
                <h2>{quoting}</h2>
                <h2>{time}</h2>
              </ul>
            ))}
    </div>
    </div>
    )
}
